INSERT INTO `general_lang` (`id`, `ids`, `lang_code`, `slug`, `value`) VALUES
(955, 'db1bf9069ed6fd00209795c4410172a4', 'th', 'why_our_services_is_the_best_desc', 'เราได้รวบรวมวิธีที่ดีที่สุดที่แตกต่างกันเพื่อมอบสิ่งที่มีคุณภาพสูงสุดในตลาด เราให้บริการที่หลากหลายแก่คุณ เราเสนอแพ็คเกจที่หลากหลายขึ้นอยู่กับความต้องการและงบประมาณของคุณ เลือกแพ็คเกจที่เหมาะกับคุณ แพ็คเกจของเรามีราคาไม่แพงซึ่งจะทำให้โปรไฟล์โซเชียลมีเดียของคุณสูงขึ้นอย่างมาก เป้าหมายเดียวของเราคือให้คุณยืนอยู่แถวหน้าและประสบความสำเร็จอย่างมาก ซื้อบริการจากเราเพื่อก้าวไปข้างหน้าและรับผลลัพธ์ที่ต้องการ เราให้บริการจัดส่งที่รวดเร็วและทำให้โพสต์ของคุณดูน่าสนใจ เลือกแพคเกจที่เหมาะสมและสั่งซื้อเพื่อให้เราสามารถดำเนินการและดำเนินการให้เสร็จโดยเร็วที่สุด\r\n                                                                                '),
(956, '7146fd0bb70fc9f80344c1e9c9862fb8', 'th', 'services_we_offer', 'บริการที่เรานำเสนอ'),
(957, 'bbfae066bc0b5726f97b4614bcd91019', 'th', 'fast_delivery', 'จัดส่งที่รวดเร็ว'),
(958, '48b6affedce94b1dfad43f3d81f5cdfb', 'th', 'youll_see_results_immediately_likes_will_be_dropping_in_as_soon_as_you_place_an_order', 'คุณจะเห็นผลลัพธ์ได้ทันที การกดไลค์จะถูกส่งในทันทีที่คุณสั่งซื้อ\r\n                                                                                '),
(959, '3e048ea39a81fe55dcd8f4b53fd09899', 'th', 'technical_support_for_all_our_services_247_to_help_you_if_you_have_some_query_drop_an_email_to_our_support_team_we_are_delighted_to_assist_you', 'Technical support for all our services 24/7 to help you. If you have some query, drop an email to our support team. We are delighted to assist you                                                                                                                                                                                                                                                '),
(960, 'd3057c8e58cea3ea03b53527b1e4d52e', 'th', 'high_quality_services', 'บริการที่มีคุณภาพสูง'),
