INSERT INTO `package_faqs` (`id`, `ids`, `cat_id`, `question`, `answer`, `sort`, `status`, `created`, `changed`) VALUES
(3, '62ad681e10a16603f5032b41d303f393', 14, 'Can I connect with my target market?', 'Of course! The whole point of buying Instagram likes is to get your campaign in front of your target market. Most people spend significant time browsing the internet, using social media, and interacting with others. You can put yourself directly in the middle of the action by developing social media accounts for your brand and increasing your following. Having well-known social media accounts gives your fan base and target market the opportunity to interact with your brand, making you personable and more down to Earth. An increase of customer interaction through Instagram is beneficial for you, your brand, and your target market because, honestly, who doesn’t love seeing updates from their favorite companies? Everyone loves seeing new products and campaigns!', NULL, 1, '2020-02-09 17:32:47', '2020-02-09 17:32:47'),
(5, '9c07828e5bc75fe6ac7acf7aacd6814f', 14, 'Why should I choose Goread.io?', 'We are experts in social media marketing and have proven ourselves with countless satisfied customers who have successfully increased their personal or business Instagram account followers. Still unsure? Well, you don’t have to take our word for it. Check out our reviews and ratings, and you’ll see for yourself that we’re the best in the industry. Goread.io doesn’t provide substandard Instagram likes. No, we only provide dependable, quality likes from followers in high-traffic networks. Our best option? You can purchase likes for all of your Instagram photos! Yep, your whole account! We can also spread your likes across several different photos to increase your following across many different photos and campaign uploads.', NULL, 1, '2020-02-09 17:34:33', '2020-02-09 17:34:33'),
(6, 'e581e69c15d54733a8058b2ffe96caff', 14, 'Is this an easy service to set up?', 'Absolutely! No sign-up pages or questionnaires are asking for unessential details about you or your company. To help you gain Insta likes, all we need is your Instagram user ID and email address. Once we get started, all you need to do is sit back, relax, and watch the Insta likes start rolling in.', NULL, 1, '2020-02-09 17:34:54', '2020-02-09 17:34:54'),
(8, '703587721426c36a711d4eca99a8e9e0', 14, 'Is buying Instagram likes within Instagram’s Terms of Use?', 'Yes, it is! Our process of providing likes for your posts is no different from your gaining likes organically from your Instagram followers. Nothing we do violates any part of Instagram’s Terms of Use. Our likes are from real accounts and are always genuine interactions between the user and your brand. View Instagram’s Terms of Use from here - https://help.instagram.com/581066165581870\r\n', NULL, 1, '2020-02-09 17:36:51', '2020-02-09 18:05:37'),
(9, 'd00a3d094aff45d772fc6e275a13d630', 14, 'What if I need automatic likes?', 'Are you worried about having to order likes for each of your posts manually? Goread.io has you covered! We offer automatic likes packages that instantly adds Instagram likes to your new posts. Our automatic package is at an affordable monthly price that saves you time and advances your connection with Instagram followers.', NULL, 1, '2020-02-09 17:38:08', '2020-02-09 18:06:29'),
(10, 'edd0bb688c9bfaf3186a94e5524b65f6', 14, 'Well, what are you waiting for?', 'Goread.io is the premiere Instagram likes provider in the market as of 2020. If you don’t already have an Instagram account for your business, you’re losing out on grabbing the attention of countless new customers. The advantages of starting an Instagram account and purchasing one of our packages means that you can gain more likes and quickly increase your brand awareness. Building an Instagram account from the bottom up, with zero likes is difficult. But it doesn’t have to be! Why not take a boost when you need it and buy Instagram likes to catapult your brand from unknown to famous?', NULL, 1, '2020-02-09 17:39:10', '2020-02-09 18:07:00'),
(11, '06cdd2e8cf56f2812e2c521f79903f8e', 13, 'Can Goread.io increase my brand awareness?', 'Absolutely! Our goal is to get your brand in front of as many people as we can. We’ll quickly increase the number of people in your target market who not only know of your brand but who are rapidly becoming valued customers. Most people spend more time on social media than any other activity. If you want to make the most of your brand’s action on Instagram, buying followers is the best course. People are more likely to interact with Instagram posts than advertisements. The best marketing strategy for your business is to increase awareness through social media.', NULL, 1, '2020-02-09 17:52:38', '2020-02-09 17:52:38'),
(12, '2688b6c344085238c092af92acba4b46', 13, 'How fast do I receive Instagram followers?', 'We’re lightning fast! As soon as your sign up and make your first payment, we begin boosting your page and finding new followers for your account in a matter of minutes. New followers come in at a fast pace as we continue boosting your posts until your purchased amount is reached. All you need to do is make your page public, order the number of followers you’d like, and then sit back and watch them roll in.', NULL, 1, '2020-02-09 17:53:05', '2020-02-09 17:53:05'),
(13, '4154be49cb518befb6963ca620e08f03', 13, 'Could I get banned from Instagram for buying followers?', 'Nope! Whatever you might have heard, buying followers is allowed. Goread.io takes your page security seriously, and we have set up an expert system that ensures your page does not get banned because of inactive Instagram followers. We always work within Instagram’s guidelines. ', NULL, 1, '2020-02-09 17:54:27', '2020-02-09 18:04:40'),
(14, 'ed2ca2a91d7ff18a2e3ede9e52838a6c', 13, 'Does Goread.io need my Instagram password?', 'No, we don’t require your password. When people follow an account on Instagram, they don’t need the account’s password. So, naturally, we don’t need yours either. Goread.io works by giving your followers through page advertisements in our network, not going into your account. We set your page up to start receiving new followers by using your Instagram username. Once you reach your target goal, your advertisement is removed, leaving you with all of your new followers. Don’t be fooled by apps that tell you to buy Instagram followers by handing over your username and password. You can get locked out of your account or have your account terminated.\r\n', NULL, 1, '2020-02-09 17:55:07', '2020-02-09 17:55:07'),
(15, '00a75524fe198fc41646a74e56f99056', 13, 'Will I lose followers when the promotion is over?', 'No! During the promotion, we are only finding you quality followers that are within Instagram guidelines. We also work to ensure your followers stay with your account for a long time after your purchase is made. We monitor your account for two weeks after the promotion to make sure your followers continue with your page.', NULL, 1, '2020-02-09 17:55:30', '2020-02-09 17:55:30'),
(16, '723fe45cf15c03cf3fc6b40a3479297a', 13, 'Are they quality followers?', 'You bet they are! We only give you the highest quality Instagram followers. Quality is one of our most important goals at Goread.io. We always make sure that your followers are long-lasting, reliable, and that the packages are affordable. Our competitors might advertise that they are the best in the business, but those are broken promises that end with sub-par followers. With Goread.io, you can rest assured you’re buying the best followers we can find with fast delivery and fantastic customer service.\r\n', NULL, 1, '2020-02-09 17:56:14', '2020-02-09 18:03:56'),
(17, '853accb12adbe658e6a377ab593e0579', 13, 'Well, when are you getting started?', 'It only takes minutes to set up your account with Goread.io and make your first purchase. Get started on the right path to becoming an Instagram influencer, promote your brand, and get your campaign in front of your target audience. Want the best, most affordable, and highest quality service in the industry? Look no further than Goread.io!', NULL, 1, '2020-02-09 17:57:44', '2020-02-09 18:01:19'),
(18, '5f9ac6030d54669ab4004c35eaad841e', 16, 'Does purchasing video views hurt my account?', 'Nope! Buying video views is allowed and does not hurt your account. The only thing adding video views does is put your brand in front of more people and help convert more followers and customers. We stay on top of all the latest changes to Instagram’s guidelines, and we take your account security seriously. You are safe with Goread.io.', NULL, 1, '2020-02-09 18:58:59', '2020-02-09 18:58:59'),
(19, '0d39e3e167fef79be8e8b32d1e1d7065', 16, 'Do I have to give you my password?', 'Not quite! We don’t need your password, but we do need your username. When you receive video views organically, people don’t need your password to watch, so neither do we!\r\n', NULL, 1, '2020-02-09 18:59:19', '2020-02-09 18:59:19'),
(20, '514abd90e6c4ab8f00b84f19019d0eaa', 16, 'How fast are you?', 'We have instant delivery! As soon as you sign up and make your first payment, our social media experts place your posts in our high-traffic network so that you can instantly start getting new views. We can deliver results in mere minutes!', NULL, 1, '2020-02-09 18:59:39', '2020-02-09 18:59:39'),
(21, '12533f5adf41da55c0804cba8d14b6eb', 16, 'Is there an option for a monthly subscription?', 'Yep! We have an affordable monthly subscription package that automatically promotes all of your new posts. You don’t have to worry about not receiving new views and likes again. We also monitor your account 24/7 to make sure every new post you add is included in your monthly subscription. If you ever need help, our customer support is available 24/7.', NULL, 1, '2020-02-09 19:00:05', '2020-02-09 19:00:05'),
(22, 'cf8d44e60d9be9b4f5f88fb41deee4cf', 16, 'How do I pay for your services?', 'Currently, we accept Visa, Mastercard, and Maestro card. We can also accept debit cards. All of your payments are safely handled by a secure payment processor that complies with all PCI DSS standards. PCI DSS standards make sure that your payment data is protected whenever you make any online purchase.\r\n', NULL, 1, '2020-02-09 19:00:26', '2020-02-09 19:00:26'),
(23, '71d3b0cca3b4a8d42da3f68bd1e08824', 16, 'Why haven’t you signed up yet?', 'Social media is currently the best way to advance your brand awareness and increase your fan base. Through Instagram, you can put your brand or product in front of as many new members of your target market as possible. With Goread.io on your side, your video campaigns will receive a large stream of new views that can turn into new followers or customers in minutes. Well, what are you waiting for?\r\n', NULL, 1, '2020-02-09 19:00:47', '2020-02-09 19:00:47'),
(24, 'bd06fa5fbfd478c9b4e0552211f863d8', 13, 'How do I pay for your services?', 'Currently, we accept Visa, Mastercard, and Maestro card. We can also accept debit cards. All of your payments are safely handled by a secure payment processor that complies with all PCI DSS standards. PCI DSS standards make sure that your payment data is protected whenever you make any online purchase.\r\n', NULL, 1, '2020-02-09 19:01:18', '2020-02-09 19:01:18');
